  SOLD: 'SOLD',
  FOR_SALE: 'FOR_SALE',
};

export const USAGE_TYPE = {
  PRIMARY: 'PRIMARY',
  SECONDARY: 'SECONDARY',
  INVESTMENT: 'INVESTMENT',
};

export const PROPERTY_STYLE = {
  FLAT: 'FLAT',
  VILLA: 'VILLA',
};

export const VOLUME_NORM = {
  SIA: 'SIA',
};

export const EXPERTISE_RATING = {
  0: 0,
  1: 1,
  2: 2,
  3: 3,
};

export const PROPERTY_QUERIES = {
  PROPERTY_ASSIGNED_TO: 'PROPERTY_ASSIGNED_TO',
};
